export const createUser = (userData) => {
   return dispatch => {
      fetch(`http://localhost:3000/users`, {
         method: 'POST',
         headers: {
            'Content-Type': 'application/json'
         },
         body: JSON.stringify({user: userData})
      })
      .then(res => res.json())
      .then(data => dispatch({
         type: "SIGNUP_SUCCESS",
         payload: {
            loggedIn: data.loggedIn,
            currentUser: data.user
         }
      }))
   }
}
